import React, { useState } from 'react';
import './EnclosureReport.css';

function EnclosureReport() {
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [location, setLocation] = useState('');
  const [queryType, setQueryType] = useState('byDates');

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Start Date:', startDate);
    console.log('End Date:', endDate);
    console.log('Location:', location);
    console.log('Query Type:', queryType);
    // Implement backend logic to send data for querying
  };

  return (
    <div className="enclosure-report-container">
      <h2>Enclosure Report</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Query Type:</label>
          <select value={queryType} onChange={(e) => setQueryType(e.target.value)}>
            <option value="byDates">By Dates</option>
            <option value="byDatesAndLocation">By Dates and Location</option>
          </select>
        </div>
        <div className="form-group">
          <label>Start Date:</label>
          <input type="date" value={startDate} onChange={(e) => setStartDate(e.target.value)} />
        </div>
        <div className="form-group">
          <label>End Date:</label>
          <input type="date" value={endDate} onChange={(e) => setEndDate(e.target.value)} />
        </div>
        {queryType === 'byDatesAndLocation' && (
          <div className="form-group">
            <label>Location:</label>
            <input type="text" value={location} onChange={(e) => setLocation(e.target.value)} />
          </div>
        )}
        <button type="submit">Generate Report</button>
      </form>
    </div>
  );
}

export default EnclosureReport;
